import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App() {
  console.log(notes);

  return (
    <div>
      <Header />
      {notes.map((note) => {
        return (
          <Note
            key={note.Item}
            title={note.title}
            content={note.content}
          />
        );
      })}
      <Footer />
    </div>
  );
}

export default App;
